import {makeAutoObservable} from "mobx";

export default class CompanyStore {
    constructor() {

            this._companies = [
            {id:1, name:"Apple",description:"description Apple", service:" service Apple", capital: 100000000, img:"data:image/jpeg;base64,"},
            {id:2, name:"Apple",description:"description Apple", service:" service Apple", capital: 100000000, img:"data:image/jpeg;base64,"},
            {id:3, name:"Apple",description:"description Apple", service:" service Apple", capital: 100000000, img:"data:image/jpeg;base64,"},
            {id:4, name:"Apple",description:"description Apple", service:" service Apple", capital: 100000000, img:"data:image/jpeg;base64,"},
        ]
        this._page = 1
        this._totalCount = 0
        this._limit = 3
        makeAutoObservable(this)
    }

    setCompanies(companies) {
        this._companies = companies
    }


    setPage(page) {
        this._page = page
    }
    setTotalCount(count) {
        this._totalCount = count
    }


    get companies() {
        return this._companies
    }

    get totalCount() {
        return this._totalCount
    }
    get page() {
        return this._page
    }
    get limit() {
        return this._limit
    }
}
